import React from "react";
import Product from './../components/Product'


const CataloguePage = (props) => {
    const {shop} = props
    if(!shop) return null;
    return(
    <div className="row">
       
        <div className="fields">
            {
        shop.map(shop=>
            <div key={shop.id}>
            <Product 
                key={shop.id} 
                {...shop}/>
            <div>
            </div>
            </div>
        )}
        </div>
    </div>
    )
}

export default CataloguePage;
